import React from 'react';
import './Header.css';

const Header = props => (
  <header className="header">
    <h1>Yankees Clicky Game!</h1>
    <h2>
      Click on a player to earn points, but don't click on any more than once!
    </h2>
  </header>
);

export default Header;
